import { useEffect, useState } from 'react';
import { connect } from 'react-redux';
import { getTemps, filterBy, activePage } from '../../../redux/actions/actions';
import { _Filter } from '../../../stl-cmp';

const Filter = ({ temps, filterBy, getTemps, activePage }) => {
	useEffect(
		() => {
			(async function() {
				return await getTemps();
			})();
		},
		[ getTemps ]
	);

	const [ temperamentos, setTemps ] = useState([]);

	const filterCans = ({ target: { value } }, valor = null) => {
		filterBy(value);
		activePage(0);
		if (valor) {
			setTemps([ ...temperamentos, value ]);
		}
	};
	const cleaner = () => {
		filterBy('CLEAN');
		document.getElementById('finder').value = '';
		document.getElementById('disabled').selected = true;
		document.querySelectorAll('.radios').forEach((e) => (e.checked = false));
		setTemps([]);
	};
	return (
		<_Filter>
			<div class="card">
				<div class="rating-container">
					<div class="rating-text">
						<p>I'm feeling...</p>
					</div>
					<div class="rating">
						<form class="rating-form">
							<label for="super-happy">
								<input
									type="radio"
									name="rating"
									className="super-happy radios"
                                    deco="super-happy"
									id="super-happy"
									onChange={filterCans}
									value="MY_CANS"
								/>
								<svg viewBox="0 0 24 24">
									<path d="M12,17.5C14.33,17.5 16.3,16.04 17.11,14H6.89C7.69,16.04 9.67,17.5 12,17.5M8.5,11A1.5,1.5 0 0,0 10,9.5A1.5,1.5 0 0,0 8.5,8A1.5,1.5 0 0,0 7,9.5A1.5,1.5 0 0,0 8.5,11M15.5,11A1.5,1.5 0 0,0 17,9.5A1.5,1.5 0 0,0 15.5,8A1.5,1.5 0 0,0 14,9.5A1.5,1.5 0 0,0 15.5,11M12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20M12,2C6.47,2 2,6.5 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2Z" />
								</svg>
							</label>

							<label for="neutral">
								<input
									type="radio"
									name="rating"
									onChange={filterCans}
									className="neutral radios"
                                    deco="neutral"
									id="neutral"
									value="API_DOGS"
								/>
								<svg
									xmlns="http://www.w3.org/2000/svg"
									xmlnsXlink="http://www.w3.org/1999/xlink"
									version="1.1"
									width="100%"
									height="100%"
									viewBox="0 0 24 24"
								>
									<path d="M8.5,11A1.5,1.5 0 0,1 7,9.5A1.5,1.5 0 0,1 8.5,8A1.5,1.5 0 0,1 10,9.5A1.5,1.5 0 0,1 8.5,11M15.5,11A1.5,1.5 0 0,1 14,9.5A1.5,1.5 0 0,1 15.5,8A1.5,1.5 0 0,1 17,9.5A1.5,1.5 0 0,1 15.5,11M12,20A8,8 0 0,0 20,12A8,8 0 0,0 12,4A8,8 0 0,0 4,12A8,8 0 0,0 12,20M12,2A10,10 0 0,1 22,12A10,10 0 0,1 12,22C6.47,22 2,17.5 2,12A10,10 0 0,1 12,2M9,14H15A1,1 0 0,1 16,15A1,1 0 0,1 15,16H9A1,1 0 0,1 8,15A1,1 0 0,1 9,14Z" />
								</svg>
							</label>

							<label for="super-sad">
								<input
									type="radio"
									name="rating"
									onChange={filterCans}
									className="super-sad radios"
                                    deco="super-sad"
									id="super-sad"
									value="TODOS"
								/>
								<svg viewBox="0 0 24 24">
									<path d="M12,2C6.47,2 2,6.47 2,12C2,17.53 6.47,22 12,22A10,10 0 0,0 22,12C22,6.47 17.5,2 12,2M12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20M16.18,7.76L15.12,8.82L14.06,7.76L13,8.82L14.06,9.88L13,10.94L14.06,12L15.12,10.94L16.18,12L17.24,10.94L16.18,9.88L17.24,8.82L16.18,7.76M7.82,12L8.88,10.94L9.94,12L11,10.94L9.94,9.88L11,8.82L9.94,7.76L8.88,8.82L7.82,7.76L6.76,8.82L7.82,9.88L6.76,10.94L7.82,12M12,14C9.67,14 7.69,15.46 6.89,17.5H17.11C16.31,15.46 14.33,14 12,14Z" />
								</svg>
							</label>
						</form>
					</div>
				</div>
			</div>
			<div>
				<select
					name=""
					id=""
					onChange={(e) => {
						filterCans(e, true);
					}}
				>
					<option id="disabled" value="" selected disabled>
						Filtrar por temperamento...
					</option>
					{temps.map((temp, i) => {
						return (
							<option key={i.toString()} value={temp.name}>
								{temp.name}
							</option>
						);
					})}
				</select>
				<div>{temperamentos.map((e) => e)}</div>
			</div>
			<button onClick={cleaner}>❌</button>
		</_Filter>
	);
};

const mapStateToProps = ({ temps }) => ({ temps });

export default connect(mapStateToProps, { filterBy, getTemps, activePage })(Filter);
